import {useEffect, useState} from "react";
import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import { faUser, faHouseChimney,faKey,faMagnifyingGlass } from "@fortawesome/free-solid-svg-icons";
import styles from "./SelectedList1.module.css";

function SelectedList1(){

    return(
        <div class="selected-list">
            <h2>선택항목 리스트</h2>

            <div class="search">
                <div class="search__box">
                    <label htmlFor='code-input'>자재코드</label>
                    <input id="code-input" placeholder="자재코드를 입력하세요"/>
                    <button>
                        <FontAwesomeIcon icon={faMagnifyingGlass} />
                    </button>
                </div>
                <div class="search__box">
                    <label htmlFor='name-input'>자재명</label>
                    <input id="name-input" placeholder="자재명을 입력하세요"/>
                    <button>
                        <FontAwesomeIcon icon={faMagnifyingGlass} />
                    </button>
                </div>
            </div>
            <div class="table">

            </div>
        </div>
    );
}

export default SelectedList1;
